//ContentApiDetails
const h3Style = {
  fontSize: "20px",
  backgroundColor: "rgb(240, 255, 255)",
  color: "rgb(31, 45, 61)",
  padding: "10px 0",
  margin: 0,
};
const h5Style = {
  fontSize: "10px",
  backgroundColor: "rgb(240, 255, 255)",
  color: "rgb(31, 45, 61)",
  padding: "10px 0",
  margin: 0,
};
const h1Style = {
  fontSize: "40px",
  backgroundColor: "rgb(240, 255, 255)",
  color: "rgb(31, 45, 61)",
  padding: "10px 0",
  margin: 0,
  textAlign: "center",
};
const dataDetailStyle = {
  display: "inline-block",
  width: "31%",
  border: "1px solid #000000",
  textAlign: "center",
  margin: "0 10px",
};

//CountryButton
const bListliStyle = {
  display: "inline-block",
  paddingRight: "10px",
};

const buttonStyle = {
  background: "none",
};

//ContentDisplay
const posStyle = {
  marginRight: "12px",
  color: "#FF8C00",
};
const deStyle = {
  marginRight: "12px",
  color: "#B22222",
};
const recStyle = {
  marginRight: "12px",
  color: "#006400",
};

export default {
  buttonStyle,
  bListliStyle,
  dataDetailStyle,
  h1Style,
  h5Style,
  h3Style,
  posStyle,
  deStyle,
  recStyle,
};
